import React from 'react';
import '../Estilos/loguin.css';

export default function InicioSesion(props) {
  return (
    <div className="login-container w-96 m-*">
        <h2 className="titulo text-xl">Iniciar sesion</h2>
        <label htmlFor="usuario">Usuario:
          <input
            type="text"
            id="usuario"
            value={props.usuario}
            onChange={(event) => props.setUsuario(event.target.value)}
          />
        </label>
        <label htmlFor="contrasena">Contrase√±a:
          <input
            type="password"
            id="contrasena"
            value={props.contrasena}
            onChange={(event) => props.setContrasena(event.target.value)}
          />
        </label>
        <button className="btn_ingresar bg-zinc-800" onClick={props.login}>Ingresar</button>
      </div>
  );
}
